package info.nukoneko.android.ho_n.sys.eventbus.event;import info.nukoneko.android.ho_n.sys.eventbus.NKEventTwitter;import twitter4j.User;/** * Created by TEJNEK on 2016/10/22. */public class OnStreamUnblock extends NKEventTwitter {    private final User source;    private final User unblockedUser;    public OnStreamUnblock(long managingUserId, User source, User unblockedUser) {        super(managingUserId);        this.source = source;        this.unblockedUser = unblockedUser;    }    public User getSource() {        return source;    }    public User getUnblockedUser() {        return unblockedUser;    }}